const JokeList = ({jokes, title}) => {

    return ( 
        <div>
            <h2>{title}</h2>
            <p>{}</p>
            <img className="image-size" src={jokes.image}/>
            <p>{jokes.description}</p>
        </div>
    );
}
 
export default JokeList;
